import { Grid ,Container} from '@mui/material'
import MyCard from '../molecules/MyCard';
interface Props{

}
const JsonFeatured=`{"books":[{"id":1,"src":"1.png","name":"Bring Your Human to Work","author":"Erica Keswin","duration":"13"},
{"id":3,"src":"3.png","name":"Doesn’t Hurt to Ask","author":"Trey Gowdy","duration":"13","noOfReads":"1.9"},
{"id":10,"src":"beyondEntrepreneur.png","name":"Beyond Entrepreneurship","author":"Jim Collins & Bill Lazier","duration":"13"}]}`

const data=JSON.parse(JsonFeatured);
const JsFeatured= data.books;
console.log(JsFeatured)

interface BookType{
  id:number,
  src:string,
  name:string,
  author:string,
  duration:string,
  noOfReads?:string,
}

const Featured=(props:Props) =>{
    return (
        <>
        <Container  style={{paddingLeft:"7%",paddingRight:"7%"}}>
      <Grid container rowSpacing={2} >

      { JsFeatured.map((book:BookType) =><Grid item xs={12} sm={6} md={4}> <MyCard id={book.id} button='add' progressBar='none'
       src={book.src} name={book.name}
      author={book.author} duration={book.duration} noOfReads={book.noOfReads}/>
       </Grid> )}
        </Grid>
        </Container>
        </>
    );
}

export default Featured;
